import { motion } from "framer-motion";

const Services = () => {
  return (
    <section id="services" className="py-16 bg-gray-100">
      <div className="container mx-auto px-6">
        <h3 className="text-3xl font-bold text-center mb-10">Our Services</h3>
        <div className="grid md:grid-cols-3 gap-8">
          {["Web Development", "Mobile Apps", "UI/UX Design"].map((service) => (
            <div key={service} className="bg-white p-6 rounded shadow text-center">
              <h4 className="text-xl font-semibold mb-2">{service}</h4>
              <p>We deliver high-quality {service.toLowerCase()} tailored to your business needs.</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Services;
